import React, {Component} from 'react';
import Home from '../pages/Home/Home';

class Home2 extends React.Component{
    render(){
        return(
    <div>
    <div className="jumbotron jumbotron-fluid cover">
        <div className="container text-center text-color">
            <h1 className="intro-name">Hello, I'm Maylen</h1>
            <p className="intro-description">Front-End Developer | UX/UI Designer</p>
        </div>
    </div>
     <section className="portfolio-section">
     <div className="container text-center">
     <h2 className="mt-5">A lovely selection of work</h2>
     <div className="container">
     <div className="row">
     <div className="col-sm-12 col-md-12">
     </div>
     <div className="col-sm-12 col-md-12">
     </div>
     </div>
     </div>
     </div>
     </section>
     </div>
        );
    }
}
export default Home2;
